function Todo(){
    const [todo, setTodo] = useState({
        dueTime : "",
        title : "abcd",
        body : "",
        status : ""
    });

    return (
        <form>
            <label>title:
                <input 
                type = "text"
                value = {setTodo.title}
                onChange = {(e) => setTodo({ title:e.target.value})}
                />
            </label>
            <p>{setTodo.title}</p>
        </form>
    );
}

export default Todo

